export default class Seeds {

  constructor() {
    this.generic_plant = {unlocked: true, quantity: 5, planted: 0, gifted: 0}
    this.tulip = {unlocked: true, quantity: 5, planted: 0, gifted: 0}
    this.sunflower = {unlocked: false, quantity: 0, planted: 0, gifted: 0}
    this.crocus = {unlocked: false, quantity: 0, planted: 0, gifted: 0}
  }

}
